import React, { useEffect, useState } from "react";

const Leaderboard = () => {
  const [scores, setScores] = useState([]);

  useEffect(() => {
    fetch("http://localhost/leaderboard-api/read.php") // Ganti path jika berbeda
      .then((res) => res.json())
      .then((data) => setScores(data.records || []))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  return (
    <div className="leaderboard">
      <h2>Leaderboard</h2>
      <table>
        <thead>
          <tr>
            <th>Nama</th>
            <th>Skor</th>
          </tr>
        </thead>
        <tbody>
          {scores.map((item, index) => (
            <tr key={index}>
              <td>{item.nama}</td>
              <td>{item.skor}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Leaderboard;
